import React from 'react';
import logo from './logo.svg';
import './App.css';

const [usersTasks, setUsersTasks] = useState(null);
const [myTasks, setMyTasks] = useState(null);

setMyTasks(
    {
        "Devon":
            [
                {taskName:"mow the grass", isComplete: false},
                {taskName:"eat some ass", isComplete: true},
                {taskName:"cry", isComplete: false},
            ]
    }
)

function App() {
  return (
    <div className="App">

    </div>
  );
}

export default App;
